import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "../Home/Home";
import Error from "../erreur/Error";
import Produits from "../Produit/produits";
import Contact from "../contact/Contact";
import Détail from "../detail/Détail";
import Login from "../Login/Login"; 

export default function Router(){
    return(
        <BrowserRouter>
        <Routes>
          <Route path="/" exact element={<Home />} />
          <Route path="/produits" element={<Produits />} />
          <Route path="/produits/:params" element={<Produits />} />
          <Route path="/Detail" element={<Détail />} />
          <Route
            path="/Detail/:categ/:libelle/:enpromo/:prix/:img"
            element={<Détail />}
          />
          <Route path="/Contact" element={<Contact />} />
          <Route path="/Login"  element={<Login />} />
          <Route path="/*" element={<Error />} />
        </Routes>
        </BrowserRouter>
    )
}
